css:
.julia table td {
  padding-left: 5px;
}
.julia .fade,
.julia.fade,
.julia.fade a {
  color: rgba(157, 165, 180, 0.6);
}
.julia.error,
.julia .error {
  color: #ff6347;
}
.julia.error a,
.julia .error a {
  color: #ff6347;
}
.julia.error .body,
.julia .error .body {
  color: #ff6347;
}
.julia.error .body .error-description,
.julia .error .body .error-description {
  color: #abb2bf;
}
.julia.error .body span [style="color:#FFF"],
.julia .error .body span [style="color:#FFF"] {
  color: #abb2bf !important;
}
atom-text-editor.editor .syntax--keyword.syntax--end {
  opacity: 0.5;
}
.error-trace .dark {
  opacity: 0.6;
}
.error-trace .medium {
  opacity: 0.8;
}
.markdown .admonition {
  margin: 1em 0;
}
.markdown .admonition .admonition-title {
  margin: 0;
  padding: 1em 1em .5em 1em;
  font-weight: bold;
}
.markdown .admonition .admonition-title:before {
  margin-right: 0.5em;
}
.markdown .admonition > .markdown {
  padding: 1em 0 0.5em 1em;
}
.markdown .admonition .admonition-title {
  background-color: #24394f;
}
.markdown .admonition .markdown {
  background-color: #253446;
}
.markdown .admonition.warning .admonition-title {
  background-color: #3c382e;
}
.markdown .admonition.warning .markdown {
  background-color: #353430;
}
.markdown .admonition.danger .admonition-title {
  background-color: #412e33;
}
.markdown .admonition.danger .markdown {
  background-color: #392d33;
}
.markdown .admonition.tip .admonition-title {
  background-color: #283d36;
}
.markdown .admonition.tip .markdown {
  background-color: #283835;
}
.markdown .admonition.compat .admonition-title {
  background-color: #35516f;
}
.markdown .admonition.compat .markdown {
  background-color: #374d67;
}
.markdown .admonition .title {
  font-weight: bold;
}
.julia-client-selector .two-lines {
  padding: 0.25em 1em  !important;
}
.julia-client-selector .two-lines .primary-line,
.julia-client-selector .two-lines .secondary-line {
  line-height: 1.8em;
}
.julia-client-selector .error-message {
  color: #ff6347;
}
.julia-client-selector .character-match {
  font-weight: bold;
}
.julia-syntax-color-selector {
  color: #abb2bf;
  background-color: #282c34;
  opacity: 0;
}
.ink-canopy.julia-profile .node.dynamic-dispatch > div {
  border: solid rgba(173, 124, 11, 0.2) 1px;
  background: rgba(173, 124, 11, 0.1);
}
.ink-canopy.julia-profile .node.dynamic-dispatch > div:hover {
  background: rgba(173, 124, 11, 0.2);
}
.ink-canopy.julia-profile .node.garbage-collection > div {
  border: solid rgba(209, 59, 46, 0.2) 1px;
  background: rgba(209, 59, 46, 0.1);
}
.ink-canopy.julia-profile .node.garbage-collection > div:hover {
  background: rgba(209, 59, 46, 0.2);
}
.ink-profile-line.dynamic-dispatch {
  background: rgba(173, 124, 11, 0.2) !important;
}
.ink-profile-line.garbage-collection {
  background: rgba(209, 59, 46, 0.2) !important;
}
atom-text-editor.editor[data-grammar$="source julia"] autocomplete-suggestion-list.select-list.popover-list .suggestion-description,
atom-text-editor.editor[data-grammar$="source weave md"] autocomplete-suggestion-list.select-list.popover-list .suggestion-description,
atom-text-editor.editor[data-grammar$="source weave latex"] autocomplete-suggestion-list.select-list.popover-list .suggestion-description {
  line-height: 1;
}
atom-text-editor.editor[data-grammar$="source julia"] autocomplete-suggestion-list.select-list.popover-list .suggestion-description .suggestion-description-content,
atom-text-editor.editor[data-grammar$="source weave md"] autocomplete-suggestion-list.select-list.popover-list .suggestion-description .suggestion-description-content,
atom-text-editor.editor[data-grammar$="source weave latex"] autocomplete-suggestion-list.select-list.popover-list .suggestion-description .suggestion-description-content {
  overflow-y: hidden;
  display: inline;
  white-space: normal;
}
/* Hack datatip component style (overwrite user's global style) */
.datatip-marked {
  max-width: 500px;
}
.datatip-marked-text-editor-container {
  padding-left: 10px;
}
.datatip-marked-container {
  font-family: system-ui;
  max-width: 500px;
}
.line-number.julia-current-cell {
  background-image: linear-gradient(to right, rgba(255, 255, 0, 0), 90%, rgba(171, 178, 191, 0.1));
}
.julia-cell-border {
  border-top: solid rgba(171, 178, 191, 0.8) 1px;
  margin-top: -1px;
}
.ink-debug-toolbar {
  --color: #9da5b4;
  --color-subtle: rgba(157, 165, 180, 0.6);
  --color-highlight: #ff6347;
}
.ink-debug-toolbar button.custom-svg-icon {
  display: flex;
  align-items: center;
  height: 2.5em!important;
}
.ink-debug-toolbar button.custom-svg-icon svg {
  height: 1.6em;
  margin: auto;
}
.terminal-link-tooltip {
  z-index: 100;
  color: #9da5b4;
  background-color: #21252b;
  padding: 0.2em 0.5em;
  position: absolute;
  border: 1px solid rgba(157, 165, 180, 0.7);
}
